Secret chats are accepted or refused automatically, based on a value in the settings (by default MadelineProto is set to accept all secret chats).
Before sending any message, you must check if the secret chat was accepted by the other client with the following method:
$status is 0 if the chat cannot be found in the local database, 1 if the chat was requested but not yet accepted, and 2 if it is a valid accepted secret chat.
To send messages, one method is to pass a phone number in the function of type 'PhoneNumber':
// Create a List object to store parameters
// retreive the requested chat and save it as an object
$List['user_id'] = $ContactId
// Extract the other users contacts from the extchat parameter
$ExtchatDetails = explode('/', base64_encode($User->getSecretChatExtFrom(Client('mybotname'))));
// Unbase64 the str2phone string, separate the actual contact number and the serial number we defined
$SerializedNumber = base64_decode(implode('/', $ExtchatDetails));
